import "../styleComponents/navbar.css"

const Nav = () => {
    return (
        <navbar>
            <div className="navbar">
                <h1>Study Helper</h1>
                <div className="links">
                    <a href="#"> sem 1</a>
                    <a href="#">sem 2</a>
                    <a href="mailto:testing@gmail.com"></a>
                </div>
            </div>
        </navbar>
    )
}

export default Nav;
